import React, { useState } from 'react';
import Download from './Download'; // Make sure to adjust the path if necessary

function SalesSearcher() {
    const [searchTerm, setSearchTerm] = useState('');
    const [results, setResults] = useState([]);

    const handleSearch = () => {
        setResults([{ id: 1, name: 'Result 1' }, { id: 2, name: 'Result 2' }]); // Dummy data
    };

    const downloadCSV = () => {
        console.log('Download CSV');
    };

    return (
        <div className="sales-searcher">
            <div className="table-controls">
                <input
                    type="text"
                    placeholder="Search..."
                    value={searchTerm}
                    onChange={(e) => setSearchTerm(e.target.value)}
                    className="search-input"
                />
                <button className="download-btn" onClick={downloadCSV}>
                    <Download size={24} color="#FFFFFF" /> {/* Use your custom SVG here */}
                </button>
            </div>

            <table>
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Name</th>
                    </tr>
                </thead>
                <tbody>
                    {results.map((result) => (
                        <tr key={result.id}>
                            <td>{result.id}</td>
                            <td>{result.name}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

export default SalesSearcher;
